import React from 'react';
import video from '../assets/Images/Home_vid'

const Home = () => {
  return (
    <div>
      <h1>Welcome to Pillar Watch</h1>
      <div style={{ float: 'left', width: '50%' }}>
        <iframe width="100%" height="315" src="https://www.youtube.com/embed/VIDEO_ID" title="Pillar Watch Video" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
      </div>
    </div>
  );
};

export default Home;
